import { useState } from 'react';

import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function NavBar() {

    const [show, setShow] = useState(false);
    
    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
    
    return (
    <div>
        <Navbar  expand="lg" bg="light">
            <Container>
                <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
                
                <Navbar.Toggle aria-controls="navbar" onClick={handleShow}/>

                <Offcanvas show={show} onHide={handleClose}>
        <Offcanvas.Header closeButton>
          <Offcanvas.Title>Offcanvas</Offcanvas.Title>
        </Offcanvas.Header>
        <Offcanvas.Body>
          Some text as placeholder. In real life you can have the elements you
          have chosen. Like, text, images, lists, etc.
        </Offcanvas.Body>
      </Offcanvas>
                
                <Navbar.Collapse id="navbar">
                    <Nav className="me-auto">
                        <Nav.Link href="#features">О нас</Nav.Link>
                        <Nav.Link href="#pricing">Проекты</Nav.Link>
                        
                        <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
                            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                        </NavDropdown>
                    </Nav>
                    
                    <Nav>
                        <Nav.Link href="#deets"><Button variant = "dark">Help Us</Button></Nav.Link>
                        <Nav.Link href="#memes"><Button variant = "info">Contact</Button></Nav.Link>
                    </Nav>
                </Navbar.Collapse>   
            </Container>
        </Navbar>
    </div>
  );
}

export default NavBar;
